import { Component} from "react"

class Signup extends Component{
    constructor(){
        super()
        this.state = {
            onlineUser:0
        }
    }

    goOnline = ()=>{
        this.setState({
            onlineUser : this.state.onlineUser+1
        })  
    }

    render (){
        return (  
            <div>
                {this.state.onlineUser}
                <button onClick={this.goOnline}>GO ONLINE</button>
            </div>
          )
    }


} 
export default Signup
